void swSPI(uint8_t cData){
    for(uint8_t bit = 0x80; bit; bit >>= 1) {
      PORTD &= ~(1<<PORTD6);    // Clk off
      if(cData & bit)   PORTD |=  (1<<PORTD7);
      else              PORTD &= ~(1<<PORTD7);
      PORTD |= (1<<PORTD6);     // Clk on
    }
}
void bootOLED(uint8_t *ptr){
    for (uint8_t i = 0; i < 10; i++){
        SPDR = *ptr++;
        while(!(SPSR & (1<<SPIF)));
    }
}

